import styled from 'styled-components';

export const Container = styled.div`
    padding-top: 150px;
    box-sizing: border-box;
    background-color: #fdf6f0;
    width: 100%;
    height: 100%;
    position: absolute;
    z-index: 1;
`

export const H1 = styled.div`
    display: block;
    font-size: 48px;
    font-family: "Lao MN",serif;
`
